  false,\n\t\"url\": null,\n\t\"notes\": \"This preliminary report is a summary of
  progress made during the 2006-07 field seasons reconstructing depositional systems
  in Tertiary strata exposed in the Homer-Kachemak Bay area.The study area addressed
  in this report extends from Clam Gulch in the north to Coal Cove in the south.Tertiary
  strata in this area are only mildly deformed and provide a relatively clear view
  of depositional systems and sand body geometries along the eastern basin edge and
  their change from basin edge to more basin axial positions.\",\n\t\"license_title\":
